import React, { useContext } from 'react'
import { Container, Row, Col } from 'react-bootstrap';
import { UserContext } from '../contexts/UserContext';

function Dashboard() {
  const user = useContext(UserContext)
  if (!user) {
    return null;
  }
  return (
    <Container className="Row Bgg">
      <Row className="align-items-center profile-header text-center text-md-left">
      <div className='container '>

      <div className='d-flex justify-content-center align-items-center'>
  <div className='col-6 row'>
    <Col md={2}>
      {user.picture && (
        <img
          src={user.picture}
          alt="Profile"
          className="rounded-circle img-fluid profile-picture mb-3 mt-5 mb-md-0"
        />
      )}
    </Col>
  </div>
  <div className='col-6'>
    <Col md>
      <h1 className='text-danger h1'>{user.name}</h1>
      <h1 className="lead text-black">{user.email}</h1>
      <h1 className='text-danger h1'>{user.role}</h1>
    </Col>
  </div>
</div>





